import React from 'react'
import {BiChevronDown} from "react-icons/bi";

const _styleChevron = {
    iconChevron:{
        width: '25px',
        height: '25px',
        borderRadius: '33px',
        color: '#767676',
        cursor: 'pointer',
    },
};

function PinChevron() {
    return (
        <BiChevronDown style={_styleChevron.iconChevron}/>
    )
}

export default PinChevron
